    return (
        <KeyboardAvoidingView style={styles.container}>
        <StatusBar style="light"/>
        <Image source={{
            uri:"https://blog.mozilla.org/internetcitizen/files/2018/08/signal-logo.png"
        }}
        style={{width:200,height:200}}
        />
       <View style={styles.inputContainer}>
